import React from 'react'

export const Nav = () => {
    return (
        <nav className="navbar">
            <ul>
                <li><a href="index.html">Home</a></li>
                <li><a href="profile.html">Profile</a></li>
                <li><a href="login.html">Login</a></li>
            </ul>
        </nav>
    )
}
